import React, { useEffect, useState } from "react";
import axios from "axios";
// import { useNavigate } from "react-router-dom";
import { Typography, TextField, Button } from "@mui/material";

function Quiz() {
    const [question, setQuestion] = useState("")
    const [answer, setAnswer] = useState("")
    const [userAnswer, setUserAnswer] = useState("")

    // const navigate = useNavigate()

    useEffect(() => {
        const getQuizData = async () => {
            try {
                const response = await axios.post('https://iiofwkaddk.execute-api.us-east-1.amazonaws.com/prod', {"QN": 4});
                const data = response.data;
                setQuestion(data.Question)
                setAnswer(data.Answer)
            } catch(error) {
                console.error(error);
            }
        };

        getQuizData();
    }, []);

    return (
        <div className="quiz">
            <form>
                <Typography variant="h5">Question 1</Typography>
                <br />
                <Typography variant="h4">{question}</Typography>
                <br />
                <br />
                <TextField
                    label="Answer"
                    variant="outlined"
                    value={userAnswer}
                    onChange={(input) => {
                        setUserAnswer(input.target.value)
                    }}
                />
                <br />
                <br />
                <Button variant="contained" color="primary">Send Answer</Button>
            </form>
        </div>
    )
}

export default Quiz
